# Code to mock the dalle server

import munch
import json

b64_img = "'"

def get_fake_dalle_result(batch_size=1):
  json_data = {
      "b64_images": [b64_img for _ in range(batch_size)]
  }
  json_bytes = json.dumps(json_data).encode('utf-8')
  return munch.Munch({
    "status": 200,
    "data": json_bytes
  })
